// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Auth/Login/Login';
import RegisterForm from './components/Auth/Register/RegisterForm';
import Dashboard from './components/Dashboard/Dashboard';
import NewsList from './components//NewList/NewsList';
import CreateNews from './components/CreateNews/CreateNews';
import EditNews from './components/EditNews/EditNews';
import NotFound from './components/NotFound/NotFound';
import PrivateRoute from './components/PrivateRoute';
import './App.css'; // Importe seu CSS aqui

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<RegisterForm />} />
                <Route path="/" element={<PrivateRoute component={Dashboard} />} />
                <Route path="/news" element={<PrivateRoute component={NewsList} />} />
                <Route path="/news/create" element={<PrivateRoute component={CreateNews} />} />
                <Route path="/news/edit/:id" element={<PrivateRoute component={EditNews} />} />
                <Route path="*" element={<NotFound />} />
            </Routes>
        </Router>
    );
};

export default App;
